std::vector<std::string> Solver::get_steps(bool display) {
    //Aplique este algoritmo manteniendo la cara blanca centrada en la parte superior y la cara naranja centrada en el frente
    this->generate_steps();    
    this->reduce_steps();
    std::vector<std::string> steps = {};

    for (int p = 0; sol2[p] != '\0'; p++) {

        //Doble rotacion
        if (sol2[p] == sol2[p + 1] && (sol2[p + 1] == 'R' || sol2[p + 1] == 'r')) {
            steps.push_back("R2");
            p++;
        }
        else if (sol2[p] == sol2[p + 1] && (sol2[p + 1] == 'L' || sol2[p + 1] == 'l')) {
            steps.push_back("L2");
            p++;
        }
        else if (sol2[p] == sol2[p + 1] && (sol2[p + 1] == 'F' || sol2[p + 1] == 'f')) {
            steps.push_back("F2");
            p++;
        }
        else if (sol2[p] == sol2[p + 1] && (sol2[p + 1] == 'B' || sol2[p + 1] == 'b')) {
            steps.push_back("B2");
            p++;
        }
        else if (sol2[p] == sol2[p + 1] && (sol2[p + 1] == 'D' || sol2[p + 1] == 'd')) {
            steps.push_back("D2");
            p++;
        }
        else if (sol2[p] == sol2[p + 1] && (sol2[p + 1] == 'U' || sol2[p + 1] == 'u')) {
            steps.push_back("U2");
            p++;
        }

        //Rotacion Anti horaria
        else if (sol2[p] != sol2[p + 1] && sol2[p] == 'r') steps.push_back("R'");
        else if (sol2[p] != sol2[p + 1] && sol2[p] == 'l') steps.push_back("L'");
        else if (sol2[p] != sol2[p + 1] && sol2[p] == 'f') steps.push_back("F'");        
        else if (sol2[p] != sol2[p + 1] && sol2[p] == 'b') steps.push_back("B'");
        else if (sol2[p] != sol2[p + 1] && sol2[p] == 'd') steps.push_back("D'");
        else if (sol2[p] != sol2[p + 1] && sol2[p] == 'u') steps.push_back("U'");

        else {
            std::string step;
            step = sol2[p];
            steps.push_back(step);
        }
    }

    if (display) display_steps(steps);
       
    return steps;
}

void Solver::display_steps(std::vector< std::string> steps) {
    
    std::cout << "Aplique este algoritmo manteniendo la cara blanca centrada en la parte superior y la cara naranja centrada en el frente" << std::endl;

    for (int i = 0; i < steps.size(); i++) std::cout << steps[i] << " ";
    
    std::cout << std::endl;
    std::cout << "Nro. de pasos: " << steps.size() << std::endl;
}


